import React from 'react';
import { Button, Container } from 'semantic-ui-react';
import { Link, withRouter } from 'react-router-dom';

const NavBar = ({ history, currentUser, logout, signUp }) => {
  const guestButtons = (
    <Container text textAlign='justified'>
      <Button as='a' onClick={() => history.push('/login')}inverted color='red' >
        Login
      </Button>

      <Button onClick={() => history.push('/login')} inverted color='red'>
        SignUp
      </Button>
    </Container>
  );

  const authButtons = (
    <Container text textAlign='justified'>
      <Button onClick={() => history.push('/search')} floated inverted color='red'>
        Search
      </Button>

      <Button inverted color='red'>
        Profile
      </Button>

      <Button inverted color='red' onClick={logout}>
        Logout
      </Button>
    </Container>
  );
  return <>{currentUser ? authButtons : guestButtons}</>;
};

export default withRouter(NavBar);
